import React from "react";
import {
  makeStyles,
  createStyles,
  Theme,
  Container,
  Typography,
  TextField,
  Grid
} from "@material-ui/core";
import { Task } from "../../../types/Task";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      height: "2000px",
      padding: theme.spacing(3)
    }
  })
);

interface Props {
  task: Task | null;
}

const MainInterface: React.FC<Props> = ({ task }) => {
  const classes = useStyles();

  if (task) {
    if (task.taskDefinitionKey === "recordDamage") {
      return (
        <Container maxWidth="xs" className={classes.root}>
          <Typography variant="h4">{task.name}</Typography>
          <Typography>Bitte f체lle das unten stehende Formular aus.</Typography>
          <form className={classes.form} noValidate autoComplete="off">
            <Grid container alignItems="center" justify="center" spacing={2}>
              <Grid item xs={3}>
                <TextField required id="firstname" label="Vorname" />
              </Grid>
              <Grid item xs={3}>
                <TextField required id="lastname" label="Nachname" />
              </Grid>
              <Grid item xs={6}></Grid>
              <Grid item xs={6}></Grid>
              <Grid item xs={6}></Grid>
              <Grid item xs={6}></Grid>
            </Grid>
          </form>
        </Container>
      );
    } else {
      return (
        <Container maxWidth="md" className={classes.root}>
          <Typography variant="h4">{task.name}</Typography>
          <Typography>Bitte w채hle einen Task aus der Liste links.</Typography>
        </Container>
      );
    }
  } else {
    return (
      <Container maxWidth="md" className={classes.root}>
        <Typography variant="h4">Kein Task ausgew채hlt</Typography>
        <Typography>Bitte w채hle einen Task aus der Liste links.</Typography>
      </Container>
    );
  }
};

export default MainInterface;
